descriptionNullable:
All news from 27 popular telegram channels about economics in russian from channels' beggining till late july 2023 (it will be updated over time). It has 1.125.184 unique texts. All channels have only news without any analitics or recommendations. And I tried to clear advertizing messeges as best as I could.
Columns:
date — date and time of news publication;
message_raw — news cleared of smiles and utility symbols such as '\n', '\t';
message_lemm — lemmatized with pymorphy2 news;
fwd_from — info about original chanel if message was forwaded
views — how much views messages have;
forwards — how much times the message was forwaded;
source — name of Telegram channel

